import React from 'react'
import './App.css'
import UserListing from './component/UserListing'

function App() {
  return (
    <div className="container">
      <div className="row">
        <div className="left-wrap">
          <form>
            <input type="text" name="search" />
          </form>
        </div>
        <div className="right-wrap">
          <UserListing />
        </div>
      </div>
    </div>
  );
}

export default App;
